import './App.css';
import Mapa from './mapa';
import data from './world-map.json'
fs = require('fs');
export class App extends React.Component {

  constructor(props, context) {
    super(props, context);

    this.state = {
    };
    this.mapRef = React.createRef();
  }

  convert(){

var m = JSON.parse(fs.readFileSync('world-map.json').toString());
m.forEach(function(p){
       p.value1= `${p.value1}`;
});
fs.writeFile('world-map.json', JSON.stringify(m));
  }


  render(){
    convert();
    return (
      <div className="App">
        <header className="App-header">
          <div className="App-header-back">
            <p className="App-header-title">Felicidad Mundial</p>
          </div>
          <div className="App-map">
            <Mapa></Mapa>
          </div>
        </header>
      </div>
    );
    }
}

export default App;
